import React, { Component } from 'react';

class Remote extends Component {
    render() {
        return (
            <div>
                <h1>Remote</h1>
                <input type="text"></input>
                <button>Randomize Image</button>
                <button>0%</button>
                <button>50%</button>
                <button>100%</button>
            </div>
        )
    }
}

export default Remote;
